import React from 'react';
import Data from '../../Data';
import './PageStyles.css';
const Home = () => {
  return (
    <section className='home'>
        {Data.map((item) =>(
        <div className='Container'>
            <div>
                
                    <div>
                        <img src={item.image} />
                    </div>
                   
            </div>
        </div>
         ))}
    </section>
  );
}
export default Home;
